import React from "react";
import { Routes, Route } from 'react-router-dom'; //Clase de direccionamiento.
import HomeForm from './HomeForm'; // P치gina web para la ruta.
import HomePage from './HomePage'; // P치gina web para la ruta.

function POF() {
  return (
  
    // /api/verifierUser
      <Routes>
        <Route path="/" element={<HomeForm />} />
        <Route path="/home/:userName" element={<HomePage />} />
      </Routes>
   
  );
}

export default POF;
